import { request } from '../utils/core.utils';
import { USER_ID } from '../utils/local-Storage.utils';



export const getAllNotes = id => {
    return request(`${id}/notes`, 'get', null);
}

export const createNote = (data)=> {
    console.log('createnote',request(`${USER_ID}/notes/createNote`, 'post', data))
    return request(`${USER_ID}/notes/createNote`, 'post', data);
}
